    lim = max(a) + 1
    counter = [0] * lim
    for num in a:
        counter[num] += 1
    mini = INF
    (n1, n2) = (INF, INF)
    for i in range(1, lim):
        (m, m1) = (INF, INF)
        for j in range(i, lim, i):
            if counter[j] >= 2:
                (m, m1) = (j, j)
                break
            if counter[j] == 1:
                if m == INF:
                    m = j
                elif m1 == INF:
                    m1 = j
                    break
        z = m * m1 // i
